$(document).ready(function(){$("[data-toggle=collapse]").click(function(){$(this).find("i").toggleClass("glyphicon-chevron-right glyphicon-chevron-down")});$(".nav-tabs a").on("click",function(b){b.preventDefault();var a=$(this).attr("id");$(this).parent().addClass("active");$(this).parent().siblings().removeClass("active");$(".tab-content").children().removeClass("active");$(".tab-content").children("#tab-pane-"+a).addClass("active")});$(".migrate-link").on("click",function(c){c.preventDefault();var b=$(this);var a=confirm("¿esta seguro de migrar el item seleccionado?");if(a!==false){$.get(b.attr("href"),function(d){if(d==="ok"){b.parent().parent().remove()}}).complete(function(){})}});$(".delete-link").on("click",function(c){c.preventDefault();var b=$(this);var a=confirm("¿Esta seguro de eliminar el item?");if(a!==false){$.post(b.attr("href"),function(d){if(d!=="ok"){console.log("Es posible que este Item tenga dependencias de otros objetos.")}else{b.parent().parent().remove()}}).complete(function(){})}})});